import React from "react";
import "./carousel.scss";

function Carousel() {
    let carouselArr =[1,2,3,4,5]
    return (
        <div className="carousel">
            {
                carouselArr.map((item,index)=>{
                    return(
                        <div key={index} className='carouse'>
                            {item}
                        </div>
                    )
                })}
                <button>left</button>
                <buton>right</buton>
        </div>
    );
}

export default Carousel;
